import { BiChevronRight } from "react-icons/bi";
import { BsSearch } from 'react-icons/bs';
const NavSm = () => {
  return (
    <><nav className="bg-indigo-900 ">
      <div>
        <div>
          <h3 className="font-bold text-white">It All Starts Here!</h3>


          <span className="text-white">
            <p className="text-white">Rajkot</p> <BiChevronRight />
            <button className="bg-rose-600 text-white rounded-lg border-rose-600 ">Use App</button>
            <BsSearch />
          </span>
        </div>

      </div>
    </nav>
    </>
  )
};
// const NavMd = () => { };
// const NavLg = () => { };

const Navbar = () => {
  return (
    <>
      <nav>
        <div className="md:hidden">{/*Mobile Screen*/}
          <NavSm />
        </div>
        <div className="hidden md:flex lg:hidden">{/*Tablet Screen*/}</div>
        <div className="hidden lg:flex">{/*Large Screen*/}</div>
      </nav>
    </>
  );
};

export default Navbar;
